# https://adventofcode.com/2020/day/11

import copy

def _main(p2):
    global _input
    cop = copy.deepcopy(_input)
    co = 5 if p2 else 4
    s1 = False if p2 else True
    # _loop(_input)

    while True:
        score = sum([scores[i] for sub in _input for i in sub])
        for y in range(len(_input)):
            for x in range(len(_input[y])):
                c = _input[y][x]
                if c == ".": continue
                
                ul = _traverse(y, x, -1, -1, s1)
                ur = _traverse(y, x, -1, 1, s1)
                u = _traverse(y, x, -1, 0, s1)
                d = _traverse(y, x, 1, 0, s1)
                l = _traverse(y, x, 0, -1, s1)
                r = _traverse(y, x, 0, 1, s1)
                dl = _traverse(y, x, 1, -1, s1)
                dr = _traverse(y, x, 1, 1, s1)
                _all = [ul, ur, u, d, l, r, dl, dr]

                if c == "L":
                    if _all.count("#") <= 0:
                        cop[y][x] = "#"
                elif c == "#":
                    if _all.count("#") >= co:
                        cop[y][x] = "L"

        newscore = sum([scores[i] for sub in cop for i in sub])
        if score == newscore:
            # _loop(_input)
            return [i for sub in cop for i in sub].count("#")
        _input = copy.deepcopy(cop)

def _loop(l):
    for i in l:
        for x in i:
            print(x, end=" ")
        print()
    print()

def _traverse(starty, startx, plusy, plusx, stop1):
    global _input
    y = starty + plusy
    x = startx + plusx
    ret = "."

    while _inside(y, x):
        ret = _input[y][x]
        if stop1: return ret
        if ret != ".":
            return ret
        y += plusy
        x += plusx

    return ret

def _inside(y, x):
    if x <= -1: return False
    if x >= len(_input[0]): return False
    if y <= -1: return False
    if y >= len(_input): return False
    return True

